import React from 'react';

const AdminDashboard = ({ stats }) => {
  const totalMeetings = stats.filter(s => s.type.includes('Meeting')).length;
  const totalDistance = stats.reduce((acc, s) => acc + (s.distanceToday || 0), 0);
  
  // Sales Fix: Case-insensitive check taaki B2B card update ho
  const b2bSales = stats.filter(s => s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2B').length;
  const b2cSales = stats.filter(s => s.type === 'Sale' && s.payload?.mode?.toUpperCase() === 'B2C').length;

  return (
    <div style={{ padding: '20px', backgroundColor: '#f4f7f6' }}>
      <h2>üõ∞Ô∏è Occamy Central Control</h2>
      
      <div style={{ display: 'flex', gap: '15px', marginBottom: '25px' }}>
        <div style={cardStyle}><h4>Total Distance</h4><p>{totalDistance} km</p></div>
        <div style={cardStyle}><h4>Meetings</h4><p>{totalMeetings}</p></div>
        <div style={cardStyle}><h4>B2B Sales</h4><p>{b2bSales}</p></div>
        <div style={cardStyle}><h4>B2C Sales</h4><p>{b2cSales}</p></div>
      </div>

      {/* Visual Bar for Hackathon Points */}
      <div style={{ background: '#fff', padding: '20px', borderRadius: '12px', marginBottom: '20px' }}>
        <h3>Sales Distribution</h3>
        <div style={{ display: 'flex', height: '30px', borderRadius: '5px', overflow: 'hidden', marginTop: '10px' }}>
          <div style={{ width: `${(b2bSales/(b2bSales+b2cSales || 1))*100}%`, background: '#3498db', color: '#fff', textAlign: 'center' }}>B2B</div>
          <div style={{ width: `${(b2cSales/(b2bSales+b2cSales || 1))*100}%`, background: '#e67e22', color: '#fff', textAlign: 'center' }}>B2C</div>
        </div>
      </div>

      <div style={{ background: '#fff', padding: '20px', borderRadius: '12px' }}>
        <h3>Ground Activity Log (Verifiable)</h3>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ textAlign: 'left', borderBottom: '2px solid #eee' }}>
              <th>Officer</th><th>Type</th><th>Village</th><th>GPS Location</th><th>Proof</th>
            </tr>
          </thead>
          <tbody>
            {stats.map(s => (
              <tr key={s.id} style={{ borderBottom: '1px solid #eee' }}>
                <td>{s.officer}</td>
                <td><strong>{s.type}</strong></td>
                <td>{s.village || 'N/A'}</td>
                <td>{s.location ? `${s.location.lat.toFixed(4)}, ${s.location.lng.toFixed(4)}` : 'N/A'}</td>
                <td>{s.photo && <a href={`http://localhost:5000${s.photo}`} target="_blank" rel="noreferrer">View Proof</a>}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const cardStyle = { flex: 1, padding: '20px', background: '#fff', borderRadius: '12px', textAlign: 'center', boxShadow: '0 2px 5px rgba(0,0,0,0.1)' };

export default AdminDashboard;
